import React from "react";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="hero">
      <h1>Hire the Best iOS Developers</h1>
      <p>We connect you with top remote iOS engineers from around the world.</p>
      <Link to="/join">
        <button className="btn-primary">Join as Developer</button>
      </Link>
    </div>
  );
}
